import React from "react";
import {
	MenuContainer,
	MenuWrap,
	MenuItens,
	MenuTitulo,
	MenuLista,
	MenuListaItem,
} from "./MenuElementos";

import LineStyleIcon from "@material-ui/icons/LineStyle";

import TimelineIcon from "@material-ui/icons/Timeline";

const Menu = () => {
	return (
		<MenuContainer>
			<MenuWrap>
				<MenuItens>
					<MenuTitulo>Painel</MenuTitulo>
					<MenuLista>
						<MenuListaItem>
							<LineStyleIcon /> Início
						</MenuListaItem>

						<MenuListaItem>
							<LineStyleIcon /> Dados Analísticos
						</MenuListaItem>

						<MenuListaItem>
							<LineStyleIcon /> Vendas
						</MenuListaItem>

						<MenuListaItem>
							<LineStyleIcon /> Transações
						</MenuListaItem>

						<MenuListaItem>
							<LineStyleIcon /> Usuários
						</MenuListaItem>

						<MenuListaItem>
							<LineStyleIcon /> Alunos
						</MenuListaItem>
					</MenuLista>
				</MenuItens>
			</MenuWrap>
		</MenuContainer>
	);
};

export default Menu;
